import React from "react";

const Listgroup = props => {
  const { genres } = props;

  return (
    <nav>
      <ul className="list-group">
        {genres.map(genre => (
          <li key={genre._id} className="list-group-item">
            {genre}
          </li>
        ))}
      </ul>
    </nav>
  );
};

export default Listgroup;
